BEGIN TRAN X

UPDATE ARTIC
   SET ARTIC.ARTIC_Descripcion = TMP.NOMBRE + ' - ' + TMP.MARCA
     , ARTIC.ARTIC_Detalle = TMP.NOMBRE + ' - ' + TMP.MARCA
